    <h3 {...{
      "id": "aws-authentication"
    }}>{`AWS Authentication`}</h3>
    <p>{`Vector checks for AWS credentials in the following order:`}</p>
    <ol>
      <li parentName="ol">{`Environment variables `}<a parentName="li" {...{
          "href": "#aws_access_key_id"
        }}><inlineCode parentName="a">{`AWS_ACCESS_KEY_ID`}</inlineCode></a>{` and `}<a parentName="li" {...{
          "href": "#aws_secret_access_key"
        }}><inlineCode parentName="a">{`AWS_SECRET_ACCESS_KEY`}</inlineCode></a>{`.`}</li>
      <li parentName="ol">{`The `}<a parentName="li" {...{
          "href": "https://docs.aws.amazon.com/cli/latest/userguide/cli-configure-sourcing-external.html"
        }}><inlineCode parentName="a">{`credential_process`}</inlineCode>{` command`}</a>{` in the AWS config file. (usually located at `}<inlineCode parentName="li">{`~/.aws/config`}</inlineCode>{`)`}</li>
      <li parentName="ol">{`The `}<a parentName="li" {...{
          "href": "https://docs.aws.amazon.com/cli/latest/userguide/cli-configure-files.html"
        }}>{`AWS credentials file`}</a>{`. (usually located at `}<inlineCode parentName="li">{`~/.aws/credentials`}</inlineCode>{`)`}</li>
      <li parentName="ol">{`The `}<a parentName="li" {...{
          "href": "https://docs.aws.amazon.com/IAM/latest/UserGuide/id_roles_use_switch-role-ec2_instance-profiles.html"
        }}>{`IAM instance profile`}</a>{`. (will only work if running on an EC2 instance with an instance profile/role)`}</li>
    </ol>
    <p>{`If credentials are not found the `}<a parentName="p" {...{
        "href": "#healthchecks"
      }}>{`healtcheck`}</a>{` will fail and an
error will be `}<a parentName="p" {...{
        "href": "/docs/administration/monitoring/#logs"
      }}>{`logged`}</a>{`.`}</p>
    <h4 {...{
      "id": "obtaining-an-access-key"
    }}>{`Obtaining an access key`}</h4>
    <p>{`In general, we recommend using instance profiles/roles whenever possible. In
cases where this is not possible you can generate an AWS access key for any user
within your AWS account. AWS provides a `}<a parentName="p" {...{
        "href": "https://docs.aws.amazon.com/IAM/latest/UserGuide/id_credentials_access-keys.html"
      }}>{`detailed guide`}</a>{` on
how to do this.`}</p>
    <h4 {...{
      "id": "assuming-roles"
    }}>{`Assuming Roles`}</h4>
    <p>{`Vector can assume an AWS IAM role via the `}<a parentName="p" {...{
        "href": "#assume_role"
      }}><inlineCode parentName="a">{`assume_role`}</inlineCode></a>{` option. This is an
optional setting that is helpful for a variety of use cases, such as cross
account access.`}</p>
    <h3 {...{
      "id": "buffers--batches"
    }}>{`Buffers & Batches`}</h3>
    <SVG src="/img/buffers-and-batches-serial.svg" mdxType="SVG" />
    <p>{`The `}<inlineCode parentName="p">{`aws_kinesis_streams`}</inlineCode>{` sink buffers & batches data as
shown in the diagram above. You'll notice that Vector treats these concepts
differently, instead of treating them as global concepts, Vector treats them
as sink specific concepts. This isolates sinks, ensuring services disruptions
are contained and `}<a parentName="p" {...{
        "href": "/docs/about/guarantees/"
      }}>{`delivery guarantees`}</a>{` are honored.`}</p>
    <p><em parentName="p">{`Batches`}</em>{` are flushed when 1 of 2 conditions are met:`}</p>
    <ol>
      <li parentName="ol">{`The batch age meets or exceeds the configured `}<a parentName="li" {...{
          "href": "#timeout_secs"
        }}><inlineCode parentName="a">{`timeout_secs`}</inlineCode></a>{`.`}</li>
      <li parentName="ol">{`The batch size meets or exceeds the configured `}<a parentName="li" {...{
          "href": "#max_events"
        }}><inlineCode parentName="a">{`max_events`}</inlineCode></a>{`.`}</li>
    </ol>
    <p><em parentName="p">{`Buffers`}</em>{` are controlled via the `}<a parentName="p" {...{
        "href": "#buffer"
      }}><inlineCode parentName="a">{`buffer.*`}</inlineCode></a>{` options.`}</p>
    <h3 {...{
      "id": "environment-variables"
    }}>{`Environment Variables`}</h3>
    <p>{`Environment variables are supported through all of Vector's configuration.
Simply add `}<inlineCode parentName="p">{`\${MY_ENV_VAR}`}</inlineCode>{` in your Vector configuration file and the variable
will be replaced before being evaluated.`}</p>
    <p>{`You can learn more in the
`}<a parentName="p" {...{
        "href": "/docs/setup/configuration/#environment-variables"
      }}>{`Environment Variables`}</a>{` section.`}</p>
    <h3 {...{
      "id": "health-checks"
    }}>{`Health Checks`}</h3>
    <p>{`Health checks ensure that the downstream service is accessible and ready to
accept data. This check is performed upon sink initialization.
If the health check fails an error will be logged and Vector will proceed to
start.`}</p>
    <h4 {...{
      "id": "require-health-checks"
    }}>{`Require Health Checks`}</h4>
    <p>{`If you'd like to exit immediately upon a health check failure, you can
pass the `}<inlineCode parentName="p">{`--require-healthy`}</inlineCode>{` flag:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`vector --config /etc/vector/vector.toml --require-healthy
`}</code></pre>
    <h4 {...{
      "id": "disable-health-checks"
    }}>{`Disable Health Checks`}</h4>
    <p>{`If you'd like to disable health checks for this sink you can set the
`}<inlineCode parentName="p">{`healthcheck`}</inlineCode>{` option to `}<inlineCode parentName="p">{`false`}</inlineCode>{`.`}</p>
    <h3 {...{
      "id": "partitioning"
    }}>{`Partitioning`}</h3>
    <p>{`By default, Vector issues random 16 byte values for each
`}<a parentName="p" {...{
        "href": "https://docs.aws.amazon.com/kinesis/latest/APIReference/API_PutRecordsRequestEntry.html#Streams-Type-PutRecordsRequestEntry-PartitionKey"
      }}>{`Kinesis record's partition key`}</a>{`, evenly
distributing records across your Kinesis partitions. Depending on your use case
this might not be sufficient since random distribution does not preserve order.
To override this, you can supply the `}<a parentName="p" {...{
        "href": "#partition_key_field"
      }}><inlineCode parentName="a">{`partition_key_field`}</inlineCode></a>{` option. This option
represents a field on your event to use for the partition key value instead.
This is useful if you have a field already on your event, and it also pairs
nicely with the `}<a parentName="p" {...{
        "href": "/docs/reference/transforms/add_fields/"
      }}><inlineCode parentName="a">{`add_fields`}</inlineCode>{` transform`}</a>{`.`}</p>
    <h4 {...{
      "id": "missing-keys-or-blank-values"
    }}>{`Missing keys or blank values`}</h4>
    <p>{`Kenisis requires a value for the partition key and therefore if the key is
missing or the value is blank the event will be dropped and a
`}<a parentName="p" {...{
        "href": "/docs/administration/monitoring/#logs"
      }}><inlineCode parentName="a">{`warning`}</inlineCode>{` level log event`}</a>{` will be logged. As such,
the field specified in the `}<a parentName="p" {...{
        "href": "#partition_key_field"
      }}><inlineCode parentName="a">{`partition_key_field`}</inlineCode></a>{` option should always contain
a value.`}</p>
    <h4 {...{
      "id": "values-that-exceed-256-characters"
    }}>{`Values that exceed 256 characters`}</h4>
    <p>{`If the value provided exceeds the maximum allowed length of 256 characters
Vector will slice the value and use the first 256 characters.`}</p>
    <h4 {...{
      "id": "non-string-values"
    }}>{`Non-string values`}</h4>
    <p>{`Vector will coerce the value into a string.`}</p>
    <h4 {...{
      "id": "provisioning--capacity-planning"
    }}>{`Provisioning & capacity planning`}</h4>
    <p>{`This is generally outside the scope of Vector but worth touching on. When you
supply your own partition key it opens up the possibility for "hot spots",
and you should be aware of your data distribution for the key you're providing.
Kinesis provides the ability to
`}<a parentName="p" {...{
        "href": "https://docs.aws.amazon.com/streams/latest/dev/kinesis-using-sdk-java-resharding-split.html"
      }}>{`manually split shards`}</a>{` to accomodate this.
If they key you're using is dynamic and unpredictable we highly recommend
recondsidering your ordering policy to allow for even and random distribution.`}</p>
    <h3 {...{
      "id": "rate-limits"
    }}>{`Rate Limits`}</h3>
    <p>{`Vector offers a few levers to control the rate and volume of requests to the
downstream service. Start with the `}<a parentName="p" {...{
        "href": "#rate_limit_duration_secs"
      }}><inlineCode parentName="a">{`rate_limit_duration_secs`}</inlineCode></a>{` and
`}<inlineCode parentName="p">{`rate_limit_num`}</inlineCode>{` options to ensure Vector does not exceed the specified
number of requests in the specified window. You can further control the pace at
which this window is saturated with the `}<a parentName="p" {...{
        "href": "#in_flight_limit"
      }}><inlineCode parentName="a">{`in_flight_limit`}</inlineCode></a>{` option, which
will guarantee no more than the specified number of requests are in-flight at
any given time.`}</p>
    <p>{`Please note, Vector's defaults are carefully chosen and it should be rare that
you need to adjust these. If you found a good reason to do so please share it
with the Vector team by `}<a parentName="p" {...{
        "href": "https://github.com/timberio/vector/issues/new?labels=sink%3A+aws_kinesis_streams"
      }}>{`opening an issue`}</a>{`.`}</p>
    <h3 {...{
      "id": "retry-policy"
    }}>{`Retry Policy`}</h3>
    <p>{`Vector will retry failed requests (status == `}<inlineCode parentName="p">{`429`}</inlineCode>{`, >= `}<inlineCode parentName="p">{`500`}</inlineCode>{`, and != `}<inlineCode parentName="p">{`501`}</inlineCode>{`).
Other responses will `}<em parentName="p">{`not`}</em>{` be retried. You can control the number of retry
attempts and backoff rate with the `}<a parentName="p" {...{
        "href": "#retry_attempts"
      }}><inlineCode parentName="a">{`retry_attempts`}</inlineCode></a>{` and
`}<inlineCode parentName="p">{`retry_backoff_secs`}</inlineCode>{` options.`}</p>
